/*

Define the skew of a DNA string Genome, denoted Skew(Genome), as the difference between the total number of occurrences of 'G' and 'C' in Genome.
Let Prefixi (Genome) denote the prefix (i.e., initial substring) of Genome of length i.
For example, the values of Skew(Prefixi ("CATGGGCATCGGCCATACGCC")) are:

0 -1 -1 -1 0 1 2 1 1 1 0 1 2 1 0 0 0 0 -1 0 -1 -2

Minimum Skew Problem
Find a position in a genome minimizing the skew.

Given: A DNA string Genome.

Return: All integer(s) i minimizing Skew(Prefixi (Text)) over all values of i (from 0 to |Genome|).

Sample Dataset
CCTATCGGTGGATTAGCATGTCCCTGTACGTTTCGCCGCGAACTAGTTCACACGGCTTGATGGCAAATGGTTTTTCCGGCGACCGTAATCGTCCACCGAG
Sample Output
53 97

*/

use std::cmp::min;

fn main() {
    assert_eq!(minimum_skew("CCTATCGGTGGATTAGCATGTCCCTGTACGTTTCGCCGCGAACTAGTTCACACGGCTTGATGGCAAATGGTTTTTCCGGCGACCGTAATCGTCCACCGAG"), vec![53, 97]);
    assert_eq!(minimum_skew(""), vec![20412, 20413]);
}

fn minimum_skew(code: &'static str) -> Vec<usize> {
    let (mut skew, mut minimum, mut index) = (vec![0], 0, 0);
    for symbol in code.chars() {
        match symbol {
            'G' => skew.push(skew[index] + 1),
            'C' => skew.push(skew[index] - 1),
            _ => skew.push(skew[index]),
        }
        minimum = min(minimum, skew[index + 1]);
        index += 1;
    }

    let mut result = vec![];
    for index in 0..skew.len() {
        if minimum == skew[index] {
            result.push(index);
        }
    }
    result
}
